import React from 'react';

import SearchIcon from '@material-ui/icons/Search';
import KeyboardIcon from '@material-ui/icons/Keyboard';
import VideoCallIcon from '@material-ui/icons/VideoCall';

import {
    Container, 
    MenuIconMaterial,
    MenuIconYoutube,
    YoutubeImage,
    DivInput,
    Input,
    IconeSearch,
    DivIconSeach
} from './styled';

// Importação dos icones da biclioteca
import MenuIcon from '@material-ui/icons/Menu';

export default () => {
    return(
        <Container>
            <MenuIconMaterial>
                <MenuIcon />
            </MenuIconMaterial>
            <MenuIconYoutube>
                <YoutubeImage  src="https://conteudo.imguol.com.br/c/noticias/57/2017/08/29/novo-logo-do-youtube-tem-icone-de-player-na-frente-e-nome-do-site-na-sequencia-1504042734067_615x300.jpg" alt=""/>
            </MenuIconYoutube>
            <DivInput>
                <Input placeholder="Pesquisar"/>
                {/* <KeyboardIcon /> */}

                <IconeSearch>
                    <DivIconSeach>
                        <SearchIcon />
                    </DivIconSeach>
                </IconeSearch>
            </DivInput>

            <DivCamera>
            <VideoCallIcon />
            </DivCamera>
        </Container>
    );
}
